def most_frequent_name(names):
    """"""
    name_freq = {}
    for name in names:
        if name not in name_freq:
            name_freq[name] = 1
        else:
            name_freq[name] += 1
    name_freq = sorted(name_freq.items(), key=lambda x: (-x[1], x[0]))
    return name_freq[0][0]
